import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Jumbotron, Grid, Row, Col, Image, Button } from "react-bootstrap";
import "./Tampere.css";
import { Carousel, CarouselItem } from "react-bootstrap";

class Tampere extends Component {
  render() {
    return (
      <body className="Tampere">
        <h1 className="Transp" />
        <h1 className="Tekstit">Tampere</h1>
        <Carousel pauseOnHover="true" className="Karuselli">
          <CarouselItem>
            <p className="Päivä">Date</p>
            <p className="Sää">-1°C</p>
            <p className="Info">Snowy</p>
          </CarouselItem>
          <CarouselItem>
            <p className="Päivä">Date</p>
            <p className="Sää">-1°C</p>
            <p className="Info">Snowy</p>
          </CarouselItem>
          <CarouselItem>
            <p className="Päivä">Date</p>
            <p className="Sää">-1°C</p>
            <p className="Info">Snowy</p>
          </CarouselItem>
        </Carousel>
      </body>
    );
  }
}

export default Tampere;
